                      function(d) {return d3.time.format('%m-%d-%y')(new Date(d*1000*3600*24));}
                      )
  .rotateLabels(   -45)
  .showMaxMin(false)
  .width(    40)

        
        
        chart.yAxis
  .axisLabel("Share")
  .showMaxMin(false)
  .width(    40)
      
       d3.select("#" + opts.id)
        .append('svg')
        .datum(data)
        .transition().duration(500)
        .call(chart);

       nv.utils.windowResize(chart.update);
       return chart;
      });
    };
